Type.registerNamespace("_u");_u.ExtensibilityStrings=function(){};_u.ExtensibilityStrings.registerClass("_u.ExtensibilityStrings");_u.ExtensibilityStrings.l_DisplayNameTooLong_Text="வழங்கப்பட்ட காட்சி பெயர்களில், ஒன்று அல்லது மேற்பட்டவை நீளமாக உள்ளன.";_u.ExtensibilityStrings.l_MessageInDifferentStoreError_Text="செய்தியானது வேறு ஸ்டோரில் சேமிக்கப்பட்டிருப்பதால், EWS ID-ஐ மீட்டெடுக்க முடியாது.";_u.ExtensibilityStrings.l_ExceededMaxNumberOfAttachments_Text="செய்தியில் ஏற்கனவே அதிகபட்ச இணைப்புகள் இருப்பதால், இணைப்புகளைச் சேர்க்க முடியாது";_u.ExtensibilityStrings.l_ParametersNotAsExpected_Text="தரப்பட்ட அளவருக்கள், எதிர்பார்க்கப்படும் வடிவமைப்புடன் பொருந்தவில்லை.";_u.ExtensibilityStrings.l_ParameterValueTooLongError_Text="'{0}' அளவுருவின் மதிப்பானது மிக நீளமாக உள்ளது. எழுத்துருக்களின் அதிகபட்ச எண்ணிக்கை '{1}'.";_u.ExtensibilityStrings.l_AttachmentErrorName_Text="இணைப்பில் பிழை";_u.ExtensibilityStrings.l_PersistedNotificationArraySaveError_Text="அறிவிப்புகளை தக்கவைக்க முடியாததால் நீங்கள் மேற்கொண்ட API அழைப்பு தோல்வியுற்றது.";_u.ExtensibilityStrings.l_CannotAddAttachmentBeforeUpgrade_Text="சேவையகத்திலிருந்து, முழுமையான பதில் அல்லது முன்னனுப்புதல் எடுக்கப்படும்போது, இணைப்புகளைச் சேர்க்க முடியாது.";_u.ExtensibilityStrings.l_InvalidActionType_Text="'actionType' அளவுருவின் மதிப்பு செல்லுபடியாகாது. ஏற்கப்படும் மதிப்பு \"showTaskPane\".";_u.ExtensibilityStrings.l_Attachment_Resource_UnAuthorizedAccess="உடனிணைப்பில் அங்கீகரிக்கப்படாத அணுகல்.";_u.ExtensibilityStrings.l_CallSaveAsyncBeforeToken_Text="உருப்படி சேமிக்கப்படும் வரை டோக்கனை மீட்டெடுக்க முடியாது.";_u.ExtensibilityStrings.l_OffsetNotfound_Text="இந்த நேர முத்திரைக்கான ஆஃப்செட் கிடைக்கவில்லை.";_u.ExtensibilityStrings.l_RecurrenceErrorMaxOccurrences_Text="மறுநிகழ்வு தொடர்ச்சியானது, அதிகபட்ச வரம்பான 999 நேர்வுகளைத் தாண்டியது.";_u.ExtensibilityStrings.l_Item_Not_Saved_Error_Text="உருப்படி சேமிக்கப்படும் வரை id-ஐ மீட்டெடுக்க முடியாது.";_u.ExtensibilityStrings.l_Attachment_Resource_Not_Found="இணைப்பு காணப்படவில்லை.";_u.ExtensibilityStrings.l_NumberOfRecipientsExceeded_Text="ஒரு புலத்தில் உள்ள மொத்த பெறுநர்களின் எண்ணிக்கை, {0}-க்கு மேல் இருக்கக் கூடாது.";_u.ExtensibilityStrings.l_PersistedNotificationArrayReadError_Text="தக்கவைத்த அறிவிப்புகளை மீட்டெடுக்க முடியாததால் நீங்கள் மேற்கொண்ட API அழைப்பு தோல்வியுற்றது.";_u.ExtensibilityStrings.l_EwsRequestOversized_Text="கோரிக்கையானது, 1 MB அளவு வரம்பை மீறுகிறது. உங்கள் EWS கோரிக்கையை மாற்றவும்.";_u.ExtensibilityStrings.l_AttachmentUrlTooLong_Text="ஒன்று அல்லது அதற்கு மேற்பட்ட உடனிணைப்பு URLகள் மிக நீளமாக உள்ளது.";_u.ExtensibilityStrings.l_Insufficient_Item_Permissions_Text="இச்செயலைச் செய்வதற்குத் தேவையான அனுமதிகள் பயனருக்கு இல்லை.";_u.ExtensibilityStrings.l_NoValidRecipientsProvided_Text="செல்லுபடியாகும் பெறுநர்கள் இல்லை.";_u.ExtensibilityStrings.l_InvalidSelection_Text="தேர்வு செல்லுபடியாகாது.";_u.ExtensibilityStrings.l_Internet_Not_Connected_Error_Text="பயனர் இனி நெட்வொர்க்கில் இணைக்கப்பட்டிருக்க மாட்டார். உங்கள் நெட்வொர்க் இணைப்பைச் சரிபார்த்து, மீண்டும் முயலவும்.";_u.ExtensibilityStrings.l_InvalidTime_Text="இந்த உள்ளீடு, சரியான தேதி அல்ல.";_u.ExtensibilityStrings.l_InvalidEndTime_Text="முடியும் நேரம், தொடக்க நேரத்திற்கு முன்னதாக இருக்க முடியாது.";_u.ExtensibilityStrings.l_ActionsDefinitionWrongNotificationMessageError_Text="இந்த அறிவிப்பு செய்தி வகைக்கு செயல்பாடுகளை வரையறுக்க முடியாது.";_u.ExtensibilityStrings.l_InvalidAttachmentId_Text="இணைப்பு ஐடி செல்லுபடியாகாதது.";_u.ExtensibilityStrings.l_SessionDataObjectMaxLengthExceeded_Text="'sessionData' பொருள் அதன் அதிகபட்ச நீளமான ‘{0}' எழுத்துக்குறிகளைக் கடந்துவிட்டது.";_u.ExtensibilityStrings.l_NotificationKeyNotFound_Text="வழங்கப்பட்ட விசையைக் கொண்ட அறிவிப்புகள் ஏதும் இல்லை.";_u.ExtensibilityStrings.l_InternalProtocolError_Text="உள்ளக நெறிமுறை பிழை: '{0}'.";_u.ExtensibilityStrings.l_Recurrence_Error_Instance_SetAsync_Text="மறுநிகழ்வுக் களவடிவத்தை தொடர்ச்சியின் ஒற்றை நிகழ்வுக்கு அமைக்க முடியாது.";_u.ExtensibilityStrings.l_Invalid_Category_Error_Text="தவறான வகைகள் வழங்கப்பட்டன.";_u.ExtensibilityStrings.l_Duplicate_Category_Error_Text="வழங்கப்பட்டுள்ள வகைகளில் ஒன்று ஏற்கனவே முதன்மை வகைப் பட்டியலில் உள்ளது.";_u.ExtensibilityStrings.l_ElevatedPermissionNeededForMethod_Text="பின்வரும் முறையை அழைக்க, மேம்பட்ட அனுமதி தேவை: '{0}'.";_u.ExtensibilityStrings.l_NullOrEmptyParameterError_Text="'{0}' அளவுரு கட்டாயமானது, காலியாகவோ வெறுமையாகவோ இருக்கக்கூடாது.";_u.ExtensibilityStrings.l_InvalidParameterValueError_Text="'{0}' அளவுருவின் மதிப்பானது செல்லுபடியாகாது.";_u.ExtensibilityStrings.l_DeleteAttachmentDoesNotExist_Text="இணைப்பை நீக்க முடியாது, ஏனெனில் இணைப்பு அட்டவணையுடன் கூடிய இணைப்பைக் கண்டறிய முடியவில்லை.";_u.ExtensibilityStrings.l_AttachmentDeleteGeneralFailure_Text="இணைப்பை, இந்த உருப்படியிலிருந்து அகற்ற முடியாது.";_u.ExtensibilityStrings.l_InvalidCommandIdError_Text="'commandId' அளவுருவின் மதிப்பு செல்லுபடியாகாது.";_u.ExtensibilityStrings.l_API_Not_Supported_For_Shared_Folders_Error="பகிரப்பட்ட கோப்புறைகளை API ஆதரிக்கப்படவில்லை.";_u.ExtensibilityStrings.l_KeyNotFound_Text="குறிப்பிட்ட விசை காணப்படவில்லை.";_u.ExtensibilityStrings.l_InternalFormatError_Text="உள்ளக வடிவமைப்பு பிழை ஏற்பட்டது.";_u.ExtensibilityStrings.l_AttachmentNotSupported_Text="உடனிணைப்பு வகை ஆதரிக்கப்படவில்லை.";_u.ExtensibilityStrings.l_HtmlSanitizationFailure_Text="HTML சுத்திகரிப்பு தோல்வியுற்றது.";_u.ExtensibilityStrings.l_DataWriteErrorName_Text="தரவு எழுதுதல் பிழை";_u.ExtensibilityStrings.l_APICallFailedDueToItemChange_Text="தேர்ந்தெடுத்த உருப்படி மாற்றப்பட்டுள்ளது.";_u.ExtensibilityStrings.l_ActionsDefinitionMultipleActionsError_Text="ஒரு செயல்பாடு மட்டுமே தற்போது ஆதரிக்கப்படும்.";_u.ExtensibilityStrings.l_SaveError_Text="சேவையகத்தில் உருப்படியை சேமிக்க முயற்சிக்கும் போது இணைப்புப் பிழை ஏற்பட்டது.";_u.ExtensibilityStrings.l_AttachmentUploadGeneralFailure_Text="இணைப்பை, இந்த உருப்படியுடன் சேர்க்க முடியாது.";_u.ExtensibilityStrings.l_DisplayReplyFormHtmlBodyRequired_Text="'htmlBody' தேவை.";_u.ExtensibilityStrings.l_CannotPersistPropertyInUnsavedDraftError_Text="சேமிக்கப்படாத வரைவுகளில் அறிவிப்புகளை தக்கவைக்க முடியாது. இந்த API-ஐ அழைப்பதற்கு முன்பு உருப்படியைச் சேமிக்கவும்.";_u.ExtensibilityStrings.l_RecurrenceInvalidTimeZone_Text="குறிப்பிடப்பட்ட நேர மண்டலம் ஆதரிக்கப்படவில்லை.";_u.ExtensibilityStrings.l_CursorPositionChanged_Text="தரவு செருகப்படும்போது, பயனர் கர்சரின் நிலையை மாற்றி விட்டார்.";_u.ExtensibilityStrings.l_RecurrenceErrorZeroOccurrences_Text="மறுநிகழ்வு தொடர்ச்சியில், குறிப்பிட்ட தேதி வரம்பில் எந்த நேர்வுகளும் இல்லை.";_u.ExtensibilityStrings.l_Recurrence_Error_Properties_Invalid_Text="மறுநிகழ்வுக் களவடிவம் செல்லுபடியாகாது. குறிப்பிட்ட மறுநிகழ்வுப் பண்புகள் மறுநிகழ்வு வகையுடன் ஒத்துப்போகிறதா என்று பார்க்கவும்.";_u.ExtensibilityStrings.l_InvalidEventDates_Text="இறுதி தேதி, தொடக்கத் தேதிக்கு முன்னதாக உள்ளது.";_u.ExtensibilityStrings.l_RecurrenceUnsupportedAlternateCalendar_Text="மாற்று நாள்காட்டியைப் பயன்படுத்தி பயனர் அமைத்த தொடர் பேட்டர்ன் ஆதரிக்கப்படவில்லை.";_u.ExtensibilityStrings.l_Olk_Http_Error_Text="கோரிக்கை தோல்வியுற்றது. HTTP பிழை குறியீட்டுக்கான பகுப்பாய்வுகள் பொருளைக் காணவும்.";_u.ExtensibilityStrings.l_InvalidDate_Text="இந்த உள்ளீடு, சரியான தேதி அல்ல.";_u.ExtensibilityStrings.l_NumberOfNotificationsExceeded_Text="அறிவிப்பு வரம்பைத் தாண்டியதால், அறிவிப்பைச் சேர்க்க முடியவில்லை.";_u.ExtensibilityStrings.l_OnlineMeetingsUserDenied_Text="பயனர் மறுத்துவிட்டார்.";_u.ExtensibilityStrings.l_TokenAccessDeniedWithoutItemContext_Text="உருப்படிக்கான சூழல் எதுவும் இல்லாத போது, படிக்கஎழுதஅஞ்சல்பெட்டி அனுமதியின் மூலம் மட்டுமே REST டோக்கன் கிடைக்கிறது.";_u.ExtensibilityStrings.l_Missing_Extended_Permissions_For_API="API அழைப்புக்கான நீட்டிக்கப்பட்ட அனுமதியை காணவில்லை.";_u.ExtensibilityStrings.l_AttachmentDeletedBeforeUploadCompletes_Text="பதிவேற்றம் முடிவடையும் முன்பே, பயனர் இணைப்பை அகற்றி விட்டார்.";_u.ExtensibilityStrings.l_API_Not_Supported_By_ExtensionPoint_Error_Text="நீட்டிப்புப் புள்ளிக்கு ஆதரிக்கப்படாத API.";_u.ExtensibilityStrings.l_ItemNotFound_Text="இந்த உருப்படி இல்லை அல்லது உருவாக்கப்படவில்லை.";_u.ExtensibilityStrings.l_DuplicateNotificationKey_Text="வழங்கப்பட்ட விசையைக் கொண்ட அறிவிப்பு ஏற்கனவே உள்ளது.";_u.ExtensibilityStrings.l_InvalidAttachmentPath_Text="இணைப்பின் பாதை செல்லுபடியாகாதது.";_u.ExtensibilityStrings.l_ElevatedPermissionNeeded_Text="Office-க்கான JavaScript API இன் பாதுகாக்கப்பட்ட உறுப்பினர்களை அணுகுவதற்கு, இன்னும் மேம்பட்ட அனுமதி தேவை.";_u.ExtensibilityStrings.l_EmailAddressTooLong_Text="வழங்கப்பட்ட மின்னஞ்சல் முகவரிகளில், ஒன்று அல்லது மேற்பட்டவை நீளமாக உள்ளன.";_u.ExtensibilityStrings.l_AttachmentExceededSize_Text="இணைப்பு மிகவும் பெரியதாக இருப்பதால், அதைச் சேர்க்க முடியாது.";_u.ExtensibilityStrings.l_Attachment_Download_Failed_Generic_Error="இணைப்பைப் பதிவிறக்குவது தோல்வியுற்றது.";_u.ExtensibilityStrings.l_AttachmentItemIdTooLong_Text="ஒன்று அல்லது அதற்கு மேற்பட்ட உடனிணைப்பு IDகள் மிக நீளமாக உள்ளது.";_u.ExtensibilityStrings.l_AttachmentNameTooLong_Text="ஒன்று அல்லது அதற்கு மேற்பட்ட உடனிணைப்பு பெயர்கள் மிக நீளமாக உள்ளது.";_u.ExtensibilityStrings.l_Internal_Server_Error_Text="Exchange சேவையகம் பிழை பதிலைப் பெற்றுள்ளது. மேலும் தகவலுக்கு, பகுப்பாய்வுகள் பொருளைக் காணவும்."